import "./App.css";
import GlassmorphismBox from "./components/glass";
import Na from "./components/glass";
import yinyang from "./media/yinyang.png";
function App() {
	return (
		<div className="App">
			<body className="App-body">
				<div class="container">
					<div class="side">
						<img src={yinyang} className="App-logo" alt="logo" />
					</div>
					<div class="side side-content-center">
						<div>
							<h1>SOUS</h1>
						</div>
					</div>
				</div>

				<GlassmorphismBox />
			</body>
		</div>
	);
}

export default App;
